DROP TABLE IF EXISTS `beneficiary_bank`;
CREATE TABLE `beneficiary_bank` (
  `id` varchar(50) NOT NULL,
  `code` varchar(6) NOT NULL,
  `name` varchar(255) NOT NULL,
  `support_type` tinyint(4) NOT NULL,
  `creator_id` bigint(20) NOT NULL,
  `creator_name` varchar(50) NOT NULL,
  `created_at` datetime(6) NOT NULL,
  `updater_id` bigint(20) NOT NULL,
  `updater_name` varchar(50) NOT NULL,
  `updated_at` datetime(6) NOT NULL,
  `data_state` tinyint(3) NOT NULL,
  `fish_bank_name` varchar(255) NOT NULL DEFAULT '',
  `fish_bank_code` varchar(50) NOT NULL DEFAULT '',
  `is_withdrawal` tinyint(4) NOT NULL DEFAULT 0 COMMENT '支援提現銀行 1: 可',
  `is_testable` TINYINT(4) NOT NULL DEFAULT 2 COMMENT '是否為測卡的收款銀行 1:是 2:否',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC;

